import React from 'react'
import Banner from '../../assets/Banner1.jpg'

function Header() {
  return (
      <header className='banner'>
              <img
                  className='header__img'
                  src={Banner}
                  alt="Banner-1"
              />

    </header>
  )
}

export default Header
